@Override
public TermDocs termDocs(Term term) throws IOException {
  if (term == null) {
    return new InstantiatedAllTermDocs(this);
  } else {
    InstantiatedTermDocs termDocs = new InstantiatedTermDocs(this);
    termDocs.seek(term);
    return termDocs;
  }
}

